// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.24;

contract Versatile {
    function hashSha256(uint256 numberToHash) public view returns (bytes32 h) {
		(bool ok, bytes memory out) = address(2).staticcall(abi.encode(numberToHash));
		require(ok);
		h = abi.decode(out, (bytes32));
    }

    function ret(bytes32 input) public view returns (bytes32 r) {
        (bool ok, bytes memory out) = address(100).staticcall(abi.encode(input));
		require(ok);
		r = abi.decode(out, (bytes32));
    } 
}

